def generate_rune_function(pixel_array, pixel_upper_limit):
    black_pixel = black_bb
    white_pixel = blank_bb

    image_grid = [
        [white_pixel if pixel > pixel_upper_limit else black_pixel for pixel in row]
        for row in pixel_array
    ]

    layers = []
    layer = image_grid[0][0]

    for i, row in enumerate(pixel_array):
        for j in range(1, len(row)):
            current_pixel = image_grid[i][j]
            frac = j / (j + 1)
            layer = stack_frac(frac, layer, current_pixel)

        layers.append(quarter_turn_left(layer))

        if i < len(pixel_array) - 1:
            layer = image_grid[i + 1][0]

    result = layers[0]
    for i in range(1, len(layers)):
        frac = i / (i + 1)
        result = stack_frac(frac, result, layers[i])

    return result
        
